import './App.css';
import Home from './Components/Home';
import Navbar from './Layout/Navbar'
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import Trading from './Components/Trading';



function App() {
  return (
    <div className="App">
      <Navbar />

      <Switch>
        <Route path="/">
          <Home />
        </Route>

        <Route path="/trade">
          <Trading />
        </Route>
      </Switch>
    </div>
  );
}

export default App;
